import { Icon, Menu } from "antd";
import styled from "styled-components";
import Links from "./navlinks";
const NavlinkWrapper = styled.div`
	color: white;
`;
const NavLinkMobile = styled.div`
	@media screen and (min-width: ${props => props.theme.phone}) {
		display: none;
	}
	@media screen and (max-width: ${props => props.theme.tablet}) {
		display: initial;
	}
	@media screen and (min-width: ${props => props.theme.tablet}) {
		display: none;
	}
`;
const NavLinkDesktop = styled.div`
	@media screen and (max-width: ${props => props.theme.tablet}) {
		display: none;
	}
	@media screen and (min-width: ${props => props.theme.tablet}) {
		display: flex;
		flex-direction: column;
		color: white;
		justify-content: center;
		text-align: center;
	}
`;
const Navlinks = () => (
	<NavlinkWrapper>
		<NavLinkMobile>
			<Links />
		</NavLinkMobile>
		<NavLinkDesktop>
			<Links />
		</NavLinkDesktop>
	</NavlinkWrapper>
);
export default Navlinks;
